import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'


function Player(props) {
    return (
      <div className="player">
      <div className="playerTitle">{this.props.PlayerName}</div>
      <div className="curScore">curScore {this.state.curScore}</div>
      <button className="totalScore">totalScore {this.state.totalScore}</button>
      </div>
    )
  }


export default Player;
